  `user_id` int(20) unsigned NOT NULL DEFAULT '0' COMMENT '发送者id',
  `target_id` int(20) unsigned NOT NULL DEFAULT '0' COMMENT '接收者id',
  `is_revoke` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否撤回 0未撤回 1已撤回',
  `is_push` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否推送消息 0否 1是',
  `type` varchar(10) NOT NULL DEFAULT 'text' COMMENT '消息类型 text文本',
  `state` int(4) unsigned NOT NULL DEFAULT '0' COMMENT '消息状态 int 0发送中，100发送成功，-100 发送失败，-200 禁止发送（内容不合法）',
  `body` text COMMENT '消息内容',
  `create_time` int(10) DEFAULT NULL COMMENT '发布时间',
  `update_time` int(10) DEFAULT NULL COMMENT '更新时间',
  `client_create_time` int(12) DEFAULT NULL COMMENT '客户端创建消息的时间戳',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `user_id_target_id` (`user_id`,`target_id`),
  KEY `is_push` (`is_push`),
  KEY `state` (`state`)
) ENGINE=InnoDB AUTO_INCREMENT=159 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='聊天消息表';
