DROP TABLE IF EXISTS `upgradation`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `upgradation` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `appid` varchar(100) DEFAULT NULL COMMENT '应用的AppID',
  `name` varchar(100) DEFAULT NULL COMMENT '应用名称',
  `title` varchar(255) DEFAULT NULL COMMENT '更新标题',
  `contents` text COMMENT '更新内容',
  `platform` varchar(255) DEFAULT NULL COMMENT '更新平台，["Android"] || ["iOS"] || ["Android","iOS"]',
  `type` varchar(30) DEFAULT NULL COMMENT '安装包类型，native_app,原生App安装包 || wgt,Wgt资源包',
  `version` varchar(10) DEFAULT NULL COMMENT '当前包版本号，必须大于当前线上发行版本号',
  `min_uni_version` varchar(10) DEFAULT NULL COMMENT '原生App最低版本',
  `url` varchar(255) DEFAULT NULL COMMENT '下载链接',
  `stable_publish` tinyint(1) DEFAULT '0' COMMENT '是否上线发行',
  `is_silently` tinyint(1) DEFAULT '0' COMMENT '是否静默更新 默认0',
  `is_mandatory` tinyint(1) DEFAULT '0' COMMENT '是否强制更新 默认0',
  `uni_platform` varchar(10) DEFAULT 'android' COMMENT 'uni平台信息，如：mp-weixin/web/ios/android',
  `create_time` int(11) DEFAULT NULL COMMENT '上传时间',
  `update_time` int(10) DEFAULT NULL COMMENT '更新时间',
  `create_env` varchar(15) DEFAULT 'upgrade-center' COMMENT '创建来源，upgrade-center：升级中心管理员创建',
  `store_list` text COMMENT '发布的应用市场	[{	id:"应用ID",	name:"应用名称",scheme:"应用scheme",enable:"是否启用，bool",priority:"优先级，按照从大到小排序，int" }]',
  PRIMARY KEY (`id`),
  KEY `appid` (`appid`),
  KEY `platform` (`platform`),
  KEY `type` (`type`),
  KEY `stable_publish` (`stable_publish`),
  KEY `uni_platform` (`uni_platform`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='升级表';
/*!40101 SET character_set_client = @saved_cs_client */;

