-- Table structure for table `user`
--

DROP TABLE IF EXISTS `user`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(80) DEFAULT NULL,
  `avatar` varchar(255) DEFAULT NULL,
  `password` varchar(255) DEFAULT NULL,
  `phone` varchar(11) DEFAULT NULL,
  `email` varchar(255) DEFAULT NULL,
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '0 禁用 1启用',
  `age` int(3) unsigned NOT NULL DEFAULT '0' COMMENT '年龄',
  `sex` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0不限 1男 2女',
  `qg` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0不限',
  `job` varchar(10) DEFAULT NULL COMMENT '职业',
  `path` varchar(255) DEFAULT NULL COMMENT '所在地',
  `birthday` varchar(20) DEFAULT NULL COMMENT '生日',
  `desc` tinytext COMMENT '个性签名',
  `wx_openid` varchar(255) DEFAULT NULL COMMENT '微信openid',
  `wx_unionid` varchar(255) DEFAULT NULL COMMENT '微信unioinid',
  `create_time` int(10) DEFAULT NULL COMMENT '注册时间',
  `update_time` int(10) DEFAULT NULL COMMENT '更新时间',
  `fans_count` int(10) DEFAULT '0' COMMENT '粉丝数',
  `follows_count` int(10) DEFAULT '0' COMMENT '关注数',
  `articles_count` int(10) DEFAULT '0' COMMENT '帖子数',
  `comments_count` int(10) DEFAULT '0' COMMENT '评论数',
  PRIMARY KEY (`id`),
  UNIQUE KEY `email` (`email`),
  UNIQUE KEY `wx_openid_wx_unionid` (`wx_openid`,`wx_unionid`),
  UNIQUE KEY `phone` (`phone`),
  KEY `username` (`username`),
  KEY `status` (`status`)
) ENGINE=InnoDB AUTO_INCREMENT=1811 DEFAULT CHARSET=utf8 COMMENT='用户表';
/*!40101 SET character_set_client = @saved_cs_client */;

